import (
	context "context"
	fern "github.com/query-parameters/fern"
	fernclient "github.com/query-parameters/fern/client"
	uuid "github.com/google/uuid"
)

client := fernclient.NewClient()
response, err := client.User.GetUsername(
	context.TODO(),
	&fern.GetUsersRequest{
		Limit: 1,
		Id: uuid.MustParse(
			"d5e9c84f-c2b2-4bf4-b4b0-7ffd7a9ffc32",
		),
		Date: fern.MustParseDate(
			"2023-01-15",
		),
		Deadline: fern.MustParseDateTime(
			"2024-01-15T09:30:00Z",
		),
		Bytes: "SGVsbG8gd29ybGQh",
		User: &fern.User{
			Name: "string",
			Tags: []string{
				"string",
			},
		},
		UserList: []*fern.User{
			&fern.User{
				Name: "string",
				Tags: []string{
					"string",
				},
			},
		},
		OptionalDeadline: fern.Time(
			fern.MustParseDateTime(
				"2024-01-15T09:30:00Z",
			),
		),
		KeyValue: map[string]string{
			"string": "string",
		},
		OptionalString: fern.String(
			"string",
		),
		NestedUser: &fern.NestedUser{
			Name: "string",
			User: &fern.User{
				Name: "string",
				Tags: []string{
					"string",
				},
			},
		},
		OptionalUser: &fern.User{
			Name: "string",
			Tags: []string{
				"string",
			},
		},
		ExcludeUser: []*fern.User{
			&fern.User{
				Name: "string",
				Tags: []string{
					"string",
				},
			},
		},
		Filter: []string{
			"string",
		},
	},
)
